const Message = () => {
  return (
    <div className=" flex flex-col justify-center items-center h-screen p-48">
      <h1 className=" font-ubuntu text-white text-5xl"> Send me a message!</h1>
      <p className=" text-white text-2xl">
        Got a question or proposal, or just want <br /> to say hello? Go ahead.
      </p>
    </div>
  );
};

